import React from "react";
import ReactDOM  from "react-dom";


const root = ReactDOM.createRoot(document.getElementById("root"));

const NavBar = (
  <div>
    <h1>Website name!</h1>
    <ul>
      <li>
        Pricing
      </li>
      <li>
        About
      </li>
      <li>
        Contact
      </li>
    </ul>
  </div>
)


root.render(NavBar);
